            </div>
          </div>
          <ScrollToTop/>
          <Chatbot />
        </div>
      ) : (
        <Notfound
          search={search}
          SetshowDropdown={SetshowDropdown}
          showDropdown={showDropdown}
        />
      )}
    </div>
  );
};

export default Entersearch;
